INSERT INTO `cms_templatemodule` VALUES ('1', '14', '2019-03-19 11:32:14', '2021-07-20 14:07:55', '<div id=\"{{{app-id}}}\" class=\"module-1 clearfix\">\r\n    <!--content begin-->\r\n    <div class=\"headTop\">\r\n        <div class=\"welcome clearfix\">\r\n            <span>欢迎访问网站！</span>\r\n            <ul class=\"fr\">\r\n                <li><a href=\"\">登录</a></li>\r\n                <li><a href=\"\">注册</a></li>\r\n                <li><a href=\"\">反馈意见</a></li>\r\n            </ul>\r\n        </div>\r\n    </div>\r\n\r\n    <!--content end-->\r\n</div>', '/cmsapi/site', '顶部欢迎提示+链接', 'module-1', '顶部欢迎提示框', ',DBHYTSK,DBHYDSK,DBHYSSK,DINGBUHUANYINGTISHIKUANG,DINGBUHUANYINGDISHIKUANG,DINGBUHUANYINGSHISHIKUANG,', '', 'rcy-admin');
INSERT INTO `cms_templatemodule` VALUES ('2', '8', '2019-03-19 11:32:28', '2019-03-26 11:24:57', '<div id=\"{{{app-id}}}\" class=\"module-2 clearfix\">\r\n    <!--content begin-->\r\n<div class=\"logo\"></div>\r\n    <!--content end-->\r\n</div>', '/cmsapi/site', '学校logo+中心名称', 'module-2', 'logo中心名称', ',LOGOZXMC,LOGOZXMC,LOGOZHONGXINMINGCHEN,LOGOZHONGXINMINGCHENG,', '', '杜雨森');
INSERT INTO `cms_templatemodule` VALUES ('3', '20', '2019-03-19 11:33:30', '2019-08-23 10:36:03', '<div id=\"{{{app-id}}}\" class=\"module-3 clearfix\" v-clock>\r\n    <!--content begin-->\r\n<div class=\"navBar\">\r\n        <ul class=\"nav\">\r\n            <li class=\"m\">\r\n                <h3><a :href=\"contextPath+\'/\'\">首页</a></h3>\r\n            </li>\r\n            <li class=\"m\" v-for=\"item in data\">\r\n                <h3><a :href=\"contextPath+\'/cms/c_\'+item.id+\'.html\'\">{{ item.name }}</a></h3>\r\n                <ul class=\"sub\" v-if=\"item.sons && item.sons.length > 0\">\r\n                    <li v-for=\"sonsItem in item.sons\"><a :href=\"contextPath+\'/cms/c_\'+sonsItem.id+\'.html\'\">{{ sonsItem.name }}</a></li>\r\n                </ul>\r\n            </li>\r\n        </ul>\r\n    </div>\r\n    <!--content end-->\r\n</div>\r\n    \r\n<script>\r\n    \r\n    var {{{vm-id}}} = new Vue({\r\n        el: \'#{{{app-id}}}\',\r\n        data:function() {\r\n            return {\r\n                data: {},\r\n                richEditorDomain:richEditorDomain,\r\ncontextPath:contextPath\r\n            }\r\n        },\r\n        methods:{\r\n        initData:function(data){\r\n        {{{vm-id}}}.data = data;\r\n        },\r\n        },\r\nmounted: function () {\r\n        siteAjax(this,\'{{{url}}}\')\r\n        },\r\n        updated:function(){\r\n             jQuery(\".module-3 .nav\").slide({\r\n                type:\"menu\", //效果类型\r\n                titCell:\".m\", // 鼠标触发对象\r\n                targetCell:\".sub\", // 效果对象，必须被titCell包含\r\n                delayTime:300, // 效果时间\r\n                triggerTime:0, //鼠标延迟触发时间\r\n                returnDefault:false//on返回初始位置\r\n            });\r\n        }\r\n    })\r\n</script>', '/cmsapi/banner', '导航栏目（默认显示二级栏目）', 'module-3', '导航栏目', ',DHLM,DAOHANGLANMU,', '', '杜雨森');
INSERT INTO `cms_templatemodule` VALUES ('4', '10', '2019-03-19 11:33:41', '2019-03-26 11:25:45', '<div id=\"{{{app-id}}}\" class=\"module-4 clearfix\">\r\n    <!--content begin-->\r\n<div class=\"slider\">\r\n<div class=\"sliderIn\">\r\n<div class=\"bd\">\r\n<ul>\r\n<li v-for=\"item in data.picArticles\">\r\n    <a :href=\"contextPath+\'/cms/c_\'+item.id+\'.html\'\">\r\n        <img :src=\"richEditorDomain+item.pic\" />\r\n        </a>\r\n    </li>\r\n</ul>\r\n</div>\r\n\r\n<div class=\"hd\">\r\n<ul>\r\n<a class=\"prev\" href=\"javascript:void(0)\"></a>\r\n<li v-for=\"item in data.picArticles\">\r\n    <img :src=\"richEditorDomain+item.pic\" />\r\n    <span class=\"arrow-up\"></span>\r\n    </li>\r\n<a class=\"next\" href=\"javascript:void(0)\"></a>\r\n</ul>\r\n</div>\r\n</div>\r\n        </div>\r\n    <!--content end-->\r\n</div>\r\n    \r\n<script>\r\n    \r\n    var {{{vm-id}}} = new Vue({\r\n        el: \'#{{{app-id}}}\',\r\n        data:function() {\r\n            return {\r\n                data: {},\r\n                richEditorDomain:richEditorDomain,\r\ncontextPath:contextPath\r\n            }\r\n        },\r\n        methods:{\r\n        initData:function(data){\r\n        {{{vm-id}}}.data = data;\r\n        },\r\n        },mounted: function () {\r\n        siteAjax(this,\'{{{url}}}\')\r\n        },\r\n        updated:function(){\r\n            jQuery(\".module-4 .slider\").slide({\r\n                mainCell: \".bd ul\",\r\n                effect: \"leftLoop\",\r\n                delayTime: 800,\r\n                autoPlay: true,\r\n                interTime:5000\r\n            });\r\n        }\r\n    })\r\n</script>', '/cmsapi/c_a/', '图片轮播+小图轮播预览', 'module-4', '图片轮播-1', ',TPLB-1,TUPIANLUNBO-1,', '', '杜雨森');
INSERT INTO `cms_templatemodule` VALUES ('5', '8', '2019-03-19 11:33:53', '2019-03-26 11:26:03', '<div id=\"{{{app-id}}}\" class=\"module-5 clearfix\">\r\n    <!--content begin-->\r\n<div class=\"slider\">\r\n        <div class=\"hd\">\r\n            <ul>\r\n                <li v-for=\"item in data.picArticles\"></li>\r\n            </ul>\r\n        </div>\r\n        <div class=\"bd\">\r\n            <ul>\r\n                <li v-for=\"item in data.picArticles\">\r\n    <a :href=\"contextPath+\'/cms/c_\'+item.id+\'.html\'\">\r\n        <img :src=\"richEditorDomain+item.pic\" />\r\n        </a>\r\n    </li>\r\n\r\n            </ul>\r\n        </div>\r\n    \r\n        <div class=\"pnBtn prev\">\r\n            <span class=\"blackBg\"></span>\r\n            <a class=\"prevBtn arrow\" href=\"javascript:void(0)\"></a>\r\n        </div>\r\n        <div class=\"pnBtn next\">\r\n            <span class=\"blackBg\"></span>\r\n            <a class=\"nextBtn arrow\" href=\"javascript:void(0)\"></a>\r\n        </div>\r\n    </div>\r\n\r\n    <!--content end-->\r\n</div>\r\n    \r\n<script>\r\n    \r\n    var {{{vm-id}}} = new Vue({\r\n        el: \'#{{{app-id}}}\',\r\n        data:function() {\r\n            return {\r\n                data: {},\r\n                richEditorDomain:richEditorDomain,\r\ncontextPath:contextPath\r\n            }\r\n        },\r\n        methods:{\r\n        initData:function(data){\r\n        {{{vm-id}}}.data = data;\r\n        },\r\n        },\r\nmounted: function () {\r\n        siteAjax(this,\'{{{url}}}\')\r\n        },\r\n        updated:function(){\r\n            /* 把最后一个放到第一个前面，然后通过外层ul{margin-left:-980px !important; }来显示第一个 */\r\n            jQuery(\".module-5 .slider .bd li\").first().before(jQuery(\".slider .bd li\").last());\r\n            /* 调用SuperSlide */\r\n            jQuery(\".module-5 .slider\").slide({\r\n                titCell: \".hd ul\",\r\n                mainCell: \".bd ul\",\r\n                effect: \"leftLoop\",\r\n                autoPlay: true,\r\n                vis: 3,\r\n                autoPage: true,\r\n                trigger: \"click\"\r\n            });\r\n        }\r\n    })\r\n</script>', '/cmsapi/c_a/', '可以左右切换带阴影', 'module-5', '图片轮播-2', ',TPLB-2,TUPIANLUNBO-2,', '', '杜雨森');
INSERT INTO `cms_templatemodule` VALUES ('6', '14', '2019-03-19 11:34:07', '2019-03-28 13:20:32', '<div class=\"section-1 clearfix\">\r\n<div id=\"{{{app-id}}}\" class=\"module-6 clearfix\">\r\n    <!--content begin-->\r\n<div class=\"contentPart\">\r\n        <div class=\"tit clearfix\">\r\n            <span>{{data.category.name}}</span>\r\n        </div>\r\n        <div class=\"aboutCenter clearfix\" v-for=\"item in data.picArticles\">\r\n            <img :src=\"richEditorDomain+item.pic\" />\r\n            <div>{{ item.intro | interceptText(150) }}<a :href=\"contextPath+\'/cms/a_\'+item.id+\'.html\'\">详情>></a></div>\r\n        </div>\r\n    </div>\r\n    <!--content end-->\r\n</div>\r\n    \r\n<script>\r\n    \r\n    var {{{vm-id}}} = new Vue({\r\n        el: \'#{{{app-id}}}\',\r\n        data:function() {\r\n            return {\r\n                data: {\r\n                    category:\'\'\r\n                },\r\n                richEditorDomain:richEditorDomain,\r\ncontextPath:contextPath\r\n            }\r\n        },\r\n        methods:{\r\n        initData:function(data){\r\n        {{{vm-id}}}.data = data;\r\n        },\r\n        },\r\n        mounted: function () {\r\n        siteAjax(this,\'{{{url}}}\')\r\n        },\r\n        filters:{\r\n            interceptText:function(text,num){\r\n                if (!text) return \'\'\r\n                var str = text.slice(0,num)+\'...\'\r\n                return str;\r\n            }\r\n        }\r\n    })\r\n</script>', '/cmsapi/c_a/', '一篇文章的简介（标题图片+文章内容）', 'module-6', '文章标题图片+文章内容介绍', ',WZBTTP+WZNRJS,WENZHANGBIAOTITUPIAN+WENZHANGNEIRONGJIESHAO,', '', '杜雨森');
INSERT INTO `cms_templatemodule` VALUES ('7', '13', '2019-03-19 11:34:18', '2019-03-29 09:07:26', '<div id=\"{{{app-id}}}\" class=\"module-7 clearfix\">\r\n    <!--content begin-->\r\n<div class=\"picScroll\">\r\n        <ul class=\"infoList\">\r\n            <li v-for=\"item in data.articles\">\r\n                <a :href=\"contextPath+\'/cms/a_\'+item.id+\'.html\'\">\r\n<span>[{{ item.lastModified | formatDate }}]</span>&nbsp;&nbsp;\r\n{{ item.name | interceptText(20) }}</a>\r\n</li>\r\n        </ul>\r\n    </div>\r\n    <!--content end-->\r\n</div>\r\n    \r\n<script>\r\n    \r\n    var {{{vm-id}}} = new Vue({\r\n        el: \'#{{{app-id}}}\',\r\n        data:function() {\r\n            return {\r\n                data: {},\r\n                richEditorDomain:richEditorDomain,\r\ncontextPath:contextPath\r\n            }\r\n        },\r\n        methods:{\r\n        initData:function(data){\r\n        {{{vm-id}}}.data = data;\r\n        },\r\n        },\r\nmounted: function () {\r\n        siteAjax(this,\'{{{url}}}\')\r\n        },\r\n        updated:function(){\r\n            jQuery(\".module-7 .picScroll\").slide({mainCell:\"ul\",autoPlay:true,effect:\"leftMarquee\",interTime:70,trigger:\"click\",vis:3});\r\n        },\r\n        filters: {\r\n          formatDate: function (date) {\r\n            if (!date) return \'\'\r\n            var newsDate = new Date(date);\r\n            \r\n            var y = Number(newsDate.getFullYear());\r\n            var m = Number(newsDate.getMonth())+1;\r\n            var s = Number(newsDate.getDay());\r\n            return y+\'-\'+(m<10?\'0\'+m:m)+\'-\'+(s<10?\'0\'+s:s)\r\n          },\r\n          interceptText:function(text,num){\r\n                var str = text.slice(0,num)+\'...\'\r\n                return str;\r\n            }\r\n        }\r\n    })\r\n</script>', '/cmsapi/c_a/', '新闻列表横向滚动', 'module-7', '滚动新闻', ',GDXW,GUNDONGXINWEN,', '', '杜雨森');
INSERT INTO `cms_templatemodule` VALUES ('8', '7', '2019-03-19 11:34:35', '2019-03-26 09:48:15', '<div id=\"{{{app-id}}}\" class=\"module-8 clearfix\">\r\n    <!--content begin-->\r\n<div class=\"focusBox\">\r\n<ul class=\"pic\">\r\n<li v-for=\"item in data.picArticles\">\r\n    <a :href=\"contextPath+\'/cms/a_\'+item.id+\'.html\'\">\r\n        <img :src=\"richEditorDomain+item.pic\" />\r\n        </a>\r\n            </li>\r\n</ul>\r\n<div class=\"txt-bg\"></div>\r\n<div class=\"txt\">\r\n<ul>\r\n<li v-for=\"item in data.picArticles\">\r\n<a :href=\"contextPath+\'/cms/a_\'+item.id+\'.html\'\">\r\n<h3>{{ item.name | interceptText(20) }}</h3>\r\n<p>{{ item.intro | interceptText(45) }}</p>\r\n</a>\r\n</li>\r\n</ul>\r\n</div>\r\n<ul class=\"num\">\r\n<li v-for=\"(item,index) in data.picArticles\">\r\n    <a>{{index}}</a><span></span>\r\n    </li>\r\n</ul>\r\n</div>\r\n    <!--content end-->\r\n</div>\r\n    \r\n<script>\r\n    \r\n    var {{{vm-id}}} = new Vue({\r\n        el: \'#{{{app-id}}}\',\r\n        data:function() {\r\n            return {\r\n                data: {},\r\n                richEditorDomain:richEditorDomain,\r\ncontextPath:contextPath\r\n            }\r\n        },\r\n        methods:{\r\n        initData:function(data){\r\n        {{{vm-id}}}.data = data;\r\n        },\r\n        },\r\nmounted: function () {\r\n        siteAjax(this,\'{{{url}}}\')\r\n        },\r\n        updated:function(){\r\n            \r\n            jQuery(\".module-8 .focusBox\").slide({ titCell:\".num li\", mainCell:\".pic\",effect:\"fold\", autoPlay:true,trigger:\"click\",interTime:4000,\r\n            //下面startFun代码用于控制文字上下切换\r\n            startFun:function(i){\r\n             jQuery(\".module-8 .focusBox .txt li\").eq(i).animate({\"bottom\":0}).siblings().animate({\"bottom\":-54});\r\n            }\r\n            });\r\n        },\r\n        filters:{\r\n            interceptText:function(text,num){\r\n                if (!text) return \'\'\r\n                var str = text.slice(0,num)+\'...\'\r\n                return str;\r\n            }\r\n        }\r\n\r\n    })\r\n</script>', '/cmsapi/c_a/', '小图轮播+带标题', 'module-8', '小图轮播 带标题', ',XTLB DBT,XIAOTULUNBO DAIBIAOTI,', '', '杜雨森');
INSERT INTO `cms_templatemodule` VALUES ('9', '4', '2019-03-19 11:34:50', '2019-03-26 09:48:26', '<div id=\"{{{app-id}}}\" class=\"module-9 clearfix\">\r\n    <!--content begin-->\r\n<div class=\"ifocus-box\">\r\n            <div class=\"img-box fl\">\r\n                <ul class=\"centerImg\">\r\n                    <li v-for=\"item in data.picArticles\">\r\n                        <a :href=\"contextPath+\'/cms/a_\'+item.id+\'.html\'\">\r\n                            <img :src=\"richEditorDomain+item.pic\" />\r\n                        </a>\r\n                    </li>\r\n                </ul>\r\n            </div>\r\n            \r\n            <div class=\"centerBox fr\">\r\n                <div class=\"centerTop\" v-for=\"item in articles\">\r\n                    <div class=\"tit\">\r\n                        <span>{{ data.category.name }}</span>\r\n                        <a :href=\"contextPath+\'/cms/c_\'+data.category.id+\'.html\'\"></a>\r\n                    </div>\r\n                    <p class=\"nr\">{{ item.intro | interceptText(50)}}</p>\r\n                </div>\r\n\r\n                <div class=\"centerBottom\">\r\n                    <ul class=\"clearfix\">\r\n                        <li v-for=\"item in data.picArticles\">\r\n                            <img :src=\"richEditorDomain+item.pic\" />\r\n                        </li>\r\n                    </ul>\r\n                </div>\r\n            </div>\r\n        </div>\r\n    <!--content end-->\r\n</div>\r\n\r\n<script>\r\n    \r\n    var {{{vm-id}}} = new Vue({\r\n        el: \'#{{{app-id}}}\',\r\n        data:function() {\r\n            return {\r\n                data: {\r\n                    category:{\r\n                        name:\'\'\r\n                    }\r\n                },\r\n                richEditorDomain:richEditorDomain,\r\ncontextPath:contextPath\r\n            }\r\n        },\r\n        methods:{\r\n        initData:function(data){\r\n        {{{vm-id}}}.data = data;\r\n        },\r\n        },\r\n        mounted: function () {\r\n        siteAjax(this,\'{{{url}}}\')\r\n        },\r\n        updated:function(){\r\n            //大图滚动\r\n            jQuery(\".ifocus-box\").slide({ titCell:\".centerBottom li\", mainCell:\".img-box ul\",effect:\"top\", delayTime:200, autoPlay:true,triggerTime:0});\r\n        },\r\n        filters:{\r\n            interceptText:function(text,num){\r\n                if (!text) return \'\'\r\n                var str = text.slice(0,num)+\'...\'\r\n                return str;\r\n            }\r\n        }\r\n    })\r\n</script>', '/cmsapi/c_a/', '一篇文章介绍+图片滚动', 'module-9', '一篇文章介绍+图片滚动', ',YPWZJS+TPGD,YIPIANWENZHANGJIESHAO+TUPIANGUNDONG,', '', '杜雨森');
INSERT INTO `cms_templatemodule` VALUES ('10', '8', '2019-03-19 11:35:05', '2019-03-28 13:21:08', '<div id=\"{{{app-id}}}\" class=\"module-10 clearfix\">\r\n    <!--content begin-->\r\n<div class=\"conTitle clearfix\">\r\n        <p>{{ data.category.name }}</p>\r\n        <span>{{ data.category.enName }}</span>\r\n        <a :href=\"contextPath+\'/cms/c_\'+data.category.id+\'.html\'\"></a>\r\n    </div>\r\n    <div class=\"noticBox\">\r\n        <ul>\r\n            <li class=\"clearfix\" v-for=\"item in data.article\">\r\n                <div class=\"date fl\">\r\n                    <span class=\"mm\">{{ item.lastModified | getDays }}</span>\r\n                    <span class=\"yy\">{{ item.lastModified | getYearsMonth }}</span>\r\n                </div>\r\n                <div class=\"noticNr fr\">\r\n                    <a class=\"noticTit\" :href=\"contextPath+\'/cms/a_\'+item.id+\'.html\'\">{{ item.name | interceptText(20) }}</a>\r\n                    <span class=\"noticP\" >{{ item.intro | interceptText(55) }}</span>\r\n                </div>\r\n            </li>\r\n        </ul>\r\n    </div>\r\n    <!--content end-->\r\n</div>\r\n    \r\n<script>\r\n    \r\n    var {{{vm-id}}} = new Vue({\r\n        el: \'#{{{app-id}}}\',\r\n        data:function() {\r\n            return {\r\n                data: {\r\n                    category:{\r\n                        name:\'\'\r\n                    }\r\n                },\r\n                richEditorDomain:richEditorDomain,\r\ncontextPath:contextPath\r\n            }\r\n        },\r\n        methods:{\r\n        initData:function(data){\r\n        {{{vm-id}}}.data = data;\r\n        },\r\n        },\r\nmounted: function () {\r\n        siteAjax(this,\'{{{url}}}\')\r\n        },\r\n        filters:{\r\n            getDays:function(value){\r\n                if (!value) return \'\';\r\n                var nowDate = new Date(value);\r\n                var today = nowDate.getDay();\r\n                return today<10?\'0\'+today:today;\r\n                \r\n            },\r\n            getYearsMonth:function(value){\r\n                if (!value) return \'\';\r\n                var nowDate = new Date(value);\r\n                var year = nowDate.getFullYear();\r\n                var month = nowDate.getMonth()+1;\r\n                return year + \'-\' + month<10?\'0\'+month:month ;\r\n            },\r\n            interceptText:function(text,num){\r\n                if (!value) return \'\';\r\n                var str = text.slice(0,num)+\'...\'\r\n                return str;\r\n            }\r\n        }\r\n    })\r\n</script>', '/cmsapi/c_a/', '日期标题文字简介的列表', 'module-10', '文章列表（标题+文字介绍）', ',WZLB（BT+WZJS）,WENZHANGLIEBIAO（BIAOTI+WENZIJIESHAO）,', '', '杜雨森');
INSERT INTO `cms_templatemodule` VALUES ('11', '9', '2019-03-19 11:35:23', '2019-03-26 10:50:18', '<div id=\"{{{app-id}}}\" class=\"module-11 clearfix\">\r\n    <!--content begin-->\r\n<div class=\"news-list\">\r\n<div class=\"tit\">\r\n<span>{{ data.category.name }}</span>\r\n<a :href=\"contextPath+\'/cms/c_\'+data.category.id+\'.html\">更多</a>\r\n</div>\r\n<div class=\"top clearfix\" v-for=\"item in data.picArticles\">\r\n    <a :href=\"contextPath+\'/cms/a_\'+item.id+\'.html\'\">\r\n    <img :src=\"richEditorDomain+item.pic\" alt=\"\">\r\n    <b>{{ item.name }}</b>\r\n    <p style=\"width: 480px;\" v-html=\"item.intro\"></p>\r\n</a>\r\n</div>\r\n<ul>\r\n<li v-for=\"item in data.articles\">\r\n    <a :href=\"contextPath+\'/cms/a_\'+item.id+\'.html\'\">\r\n    <span class=\"data\">\r\n    <b>{{ item.lastModified | getYear }}</b>\r\n    {{ item.lastModified | getMonthDays }}\r\n    </span>\r\n    <h3>{{ item.name | interceptText(25) }}</h3>\r\n    <p>{{ item.intro | interceptText(95) }}</p>\r\n</a>\r\n</li>\r\n</ul>\r\n</div>\r\n    <!--content end-->\r\n</div>\r\n    \r\n<script>\r\n    \r\n    var {{{vm-id}}} = new Vue({\r\n        el: \'#{{{app-id}}}\',\r\n        data:function() {\r\n            return {\r\n                data: {\r\n                    category:{\r\n                        name:\'\'\r\n                    }\r\n                },\r\n                richEditorDomain:richEditorDomain,\r\ncontextPath:contextPath\r\n            }\r\n        },\r\n        methods:{\r\n        initData:function(data){\r\n        {{{vm-id}}}.data = data;\r\n        },\r\n        },\r\n        mounted: function () {\r\n        siteAjax(this,\'{{{url}}}\')\r\n        },\r\n        filters:{\r\n            getYear:function(value){\r\n                if (!value) return \'\';\r\n                var nowDate = new Date(value);\r\n                var year = nowDate.getFullYear();\r\n                return year;\r\n                \r\n            },\r\n            getMonthDays:function(value){\r\n                if (!value) return \'\';\r\n                var nowDate = new Date(value);\r\n                var month = nowDate.getMonth()+1\r\n                var today = nowDate.getDay()\r\n                return  month<10?\'0\'+month:month + \'-\' + today<10?\'0\'+today:today;\r\n            },\r\n            interceptText:function(text,num){\r\n                if (!value) return \'\';\r\n                var str = text.slice(0,num)+\'...\'\r\n                return str;\r\n            }\r\n        }\r\n    })\r\n</script>', '/cmsapi/c_a/', '首篇文章图片+简介 其他日期标题简介', 'module-11', '文章列表', ',WZLB,WENZHANGLIEBIAO,', '', '杜雨森');
INSERT INTO `cms_templatemodule` VALUES ('12', '4', '2019-03-19 11:35:37', '2019-03-26 09:48:53', '<div id=\"{{{app-id}}}\" class=\"module-12 clearfix\">\r\n    <!--content begin-->\r\n<div class=\"title\">{{ data.category.name }}</div>\r\n<div class=\"new-actives\">\r\n<div class=\"tab-bd\">\r\n    \r\n    <li v-for=\"item in data.articles\">\r\n    <span></span>\r\n    <a :href=\"contextPath+\'/cms/a_\'+item.id+\'.html\'\">\r\n    <h3>{{ item.name | interceptText(20) }}</h3>\r\n    <p>{{ item.intro | interceptText(55) }}</p>\r\n    </a>\r\n    </li>\r\n\r\n</div>\r\n<div class=\"tab-hd\">\r\n<span class=\"step\">\r\n  <a href=\"javascript:void(0)\" class=\"prev\"></a>\r\n  <a href=\"javascript:void(0)\" class=\"next\"></a>\r\n</span>\r\n  </div>\r\n</div>\r\n    <!--content end-->\r\n</div>\r\n    \r\n<script>\r\n    \r\n    var {{{vm-id}}} = new Vue({\r\n        el: \'#{{{app-id}}}\',\r\n        data:function() {\r\n            return {\r\n                data: {\r\n                    category:{\r\n                        name:\'\'\r\n                    }\r\n                },\r\n                richEditorDomain:richEditorDomain,\r\ncontextPath:contextPath\r\n            }\r\n        },\r\n        methods:{\r\n        initData:function(data){\r\n        {{{vm-id}}}.data = data;\r\n        },\r\n        },\r\n        mounted: function () {\r\n        siteAjax(this,\'{{{url}}}\')\r\n        },\r\n        updated:function(){\r\n            jQuery(\".new-actives li\").each(function(i){ jQuery(\".new-actives li\").slice(i*3,i*3+3).wrapAll(\"<ul class=\\\"clearfix\\\"></ul>\");});\r\n            jQuery(\".new-actives\").slide({ mainCell:\".tab-bd\", effect:\"top\", delayTime:400,pnLoop:false,easing:\"easeOutCubic\" });\r\n        },\r\n        filters:{\r\n            interceptText:function(text,num){\r\n                if (!text) return \'\'\r\n                var str = text.slice(0,num)+\'...\'\r\n                return str;\r\n            }\r\n        }\r\n    })\r\n</script>', '/cmsapi/c_a/', '上下滚动的文章列表 标题+介绍的形式', 'module-12', '滚动文章介绍', ',GDWZJS,GUNDONGWENZHANGJIESHAO,', '', '杜雨森');
INSERT INTO `cms_templatemodule` VALUES ('13', '4', '2019-03-19 11:35:50', '2019-06-03 11:50:00', '<div id=\"{{{app-id}}}\" class=\"module-13 clearfix\">\r\n    <!--content begin-->\r\n	<div class=\"contentCategory clearfix\">\r\n        <div class=\"breadcrumb\">\r\n            <ul>\r\n                <li class=\"fl\">当前位置：<a :href=\"contextPath+\'/\'\">首页</a></li>\r\n                <li class=\"fl\">&nbsp;&gt;&nbsp;<a :href=\"contextPath+\'cms/c_\'+data.category.id+\'.html\'\">{{ data.category.name }}</a></li>\r\n            </ul>\r\n        </div>\r\n        <div class=\"clearfix\" v-if=\"data.articles.totalElements > 1\">\r\n            <div class=\"aside fl\">\r\n                <h2>{{ data.category.name }}</h2>\r\n                <ul class=\"level2\">\r\n                    <li v-for=\"item in data.category.sons\">\r\n                        <a :href=\"contextPath+\'/cms/c_\'+item.id+\'.html\'\" :class=\"[data.currentId == item.id?\'current\':\'\']\">{{ item.name }}</a>\r\n                    </li>\r\n                </ul>\r\n            </div>\r\n            <div class=\"contentLi fr\">\r\n                <div class=\"articleLi\">\r\n                    <ul>\r\n                        <li v-for=\"item in data.articles.content\">\r\n                            <a :href=\"contextPath+\'/cms/a_\'+item.id+\'.html\'\" target=\"_blank\" class=\"clearfix\">\r\n                                <h3 class=\"fl\">{{ item.name | interceptText(60) }}</h3>\r\n                                <span class=\"fr\">{{ item.lastModified | formatDate }}</span>\r\n                            </a>\r\n                        </li>\r\n                    </ul>\r\n                </div>\r\n                \r\n                <div class=\"page\"  v-show=\"show\">\r\n                    <div class=\"pagelist\">\r\n                      <span class=\"jump\" :class=\"{disabled:pstart}\" @click=\"jumpPage(--data.articles.number)\">上一页</span>\r\n                      <span v-show=\"(data.articles.number+1)>5\" class=\"jump\" @click=\"jumpPage(0)\">1</span>\r\n                      <span class=\"ellipsis\"  v-show=\"efont\">...</span>\r\n                      <span class=\"jump\" v-for=\"num in data.articles.totalPages\" :class=\"{bgprimary:(data.articles.number+1)==num}\" @click=\"jumpPage(num-1)\">{{num}}</span>\r\n                      <span class=\"ellipsis\"  v-show=\"ebehind\">...</span>\r\n                      <span :class=\"{disabled:pend}\" class=\"jump\" @click=\"jumpPage(++data.articles.number)\">下一页</span>\r\n                    </div>\r\n              </div>\r\n            </div>\r\n        </div>\r\n        <div class=\"clearfix\" v-else>\r\n            <div class=\"articlePage\" v-for=\"item in data.articles.content\">\r\n                <h2>{{ item.name | interceptText(60) }}</h2>\r\n                <div class=\"title_info\">\r\n                    发稿时间：{{ item.lastModified | formatDate }}&nbsp;&nbsp;\r\n                </div>\r\n                <div class=\"article-detail\" v-html=\"item.context\"></div>\r\n            </div>\r\n        </div>\r\n    </div>\r\n    <!--content end-->\r\n</div>\r\n    \r\n<script>\r\n    \r\n    var {{{vm-id}}} = new Vue({\r\n        el: \'#{{{app-id}}}\',\r\n        data:function() {\r\n            return {\r\n                data: {\r\n                    category:{\r\n                        \"id\":\'\',\r\n                        \"name\":\'\'\r\n                    },\r\n                    articles:{\r\n                        \"contnet\":[],\r\n                        \"totalPages\": 0,\r\n                        \"number\": 0,\r\n                    }\r\n                },\r\n                richEditorDomain:richEditorDomain,\r\n				contextPath:contextPath\r\n            }\r\n        },\r\n        methods:{\r\n        	initData:function(data){\r\n        		{{{vm-id}}}.data = data;\r\n        	},\r\n        	jumpPage:function(page){\r\n        	    location.search=\"?pageNum=\"+page\r\n        	}\r\n        },\r\n        computed:{\r\n            show:function(){\r\n                return this.data.articles.totalPages && this.data.articles.totalPages !=1\r\n            },\r\n            pstart: function() {\r\n                return this.data.articles.number+1 == 1;\r\n            },\r\n            pend: function() {\r\n                return this.data.articles.number+1 == this.data.articles.totalPages;\r\n            },\r\n            efont: function() {\r\n                if (this.data.articles.totalPages <= 7) return false;\r\n                return this.data.articles.number+1 > 5\r\n            },\r\n            ebehind: function() {\r\n                if (this.data.articles.totalPages <= 7) return false;\r\n                var nowAy = this.data.articles.totalPages;\r\n                return nowAy[nowAy.length - 1] != this.data.articles.totalPages;\r\n            }\r\n        },\r\n        mounted: function () {\r\n        	siteAjax(this,\'{{{url}}}\')\r\n        },\r\n        filters: {\r\n            formatDate: function (date) {\r\n                 if (!date) return \'\'\r\n                var newsDate = date.split(\'T\')[0];\r\n            \r\n                return newsDate\r\n            },\r\n            interceptText:function(text,num){\r\n                if (!text) return \'\'\r\n                if (text.length <=num ) return text\r\n                var str = text.slice(0,num)+\'...\'\r\n                return str;\r\n            }\r\n        }\r\n    })\r\n</script>', '/cmsapi/b_a/', '暂无', 'module-13', '二级页面模块', ',EJYMMK,EJYMMK,ERJIYEMIANMOKUAI,ERJIYEMIANMUKUAI,', '', '杜雨森');
INSERT INTO `cms_templatemodule` VALUES ('14', '3', '2019-03-19 11:36:02', '2019-08-25 20:43:02', '<div id=\"{{{app-id}}}\" class=\"module-14 clearfix\">\r\n    <!--content begin-->\r\n	<div class=\"contentCategory clearfix\">\r\n        <div class=\"breadcrumb\">\r\n            <ul>\r\n                <li class=\"fl\">当前位置：<a :href=\"contextPath+\'/\'\">首页</a></li>\r\n                <li class=\"fl\">&nbsp;&gt;&nbsp;<a :href=\"contextPath+\'c_\'+data.category.id+\'.html\'\">{{ data.category.name }}</a></li>\r\n            </ul>\r\n        </div>\r\n        <div class=\"clearfix\" v-if=\"data.articles.totalElements > 1\">\r\n            <div class=\"aside fl\">\r\n                <h2>{{ data.category.name }}</h2>\r\n                <ul class=\"level2\">\r\n                    <li v-for=\"item in data.category.sons\">\r\n                        <a :href=\"contextPath+\'/cms/c_\'+item.id+\'.html\'\" :class=\"[data.currentId == item.id?\'current\':\'\']\">{{ item.name }}</a>\r\n                    </li>\r\n                </ul>\r\n            </div>\r\n            <div class=\"contentLi fr\">\r\n                 <div class=\"picBox\">\r\n                \r\n                    <div class=\"commonPic\">\r\n                        <ul  class=\"clearfix\">\r\n                            <li v-for=\"item in data.articles.content\">\r\n                                <a :href=\"contextPath+\'/cms/a_\'+item.id+\'.html\'\" class=\"categoryPic\">\r\n                                     <img class=\"\" :src=\"richEditorDomain+item.pic\">\r\n                                </a>\r\n                                 <a :href=\"contextPath+\'/cms/a_\'+item.id+\'.html\'\" class=\"categoryPicTit categoryPic\">{{ item.name | interceptText(60) }}</a>\r\n                            </li>\r\n                        </ul>\r\n                    </div>\r\n                </div>    \r\n                \r\n                <div class=\"page\"  v-show=\"show\">\r\n                    <div class=\"pagelist\">\r\n                      <span class=\"jump\" :class=\"{disabled:pstart}\" @click=\"jumpPage(--data.articles.number)\">上一页</span>\r\n                      <span v-show=\"(data.articles.number+1)>5\" class=\"jump\" @click=\"jumpPage(0)\">1</span>\r\n                      <span class=\"ellipsis\"  v-show=\"efont\">...</span>\r\n                      <span class=\"jump\" v-for=\"num in data.articles.totalPages\" :class=\"{bgprimary:(data.articles.number+1)==num}\" @click=\"jumpPage(num-1)\">{{num}}</span>\r\n                      <span class=\"ellipsis\"  v-show=\"ebehind\">...</span>\r\n                      <span :class=\"{disabled:pend}\" class=\"jump\" @click=\"jumpPage(++data.articles.number)\">下一页</span>\r\n                    </div>\r\n              </div>\r\n            </div>\r\n        </div>\r\n        <div class=\"clearfix\" v-else>\r\n            <div class=\"articlePage\" v-for=\"item in data.articles.content\">\r\n                <h2>{{ item.name | interceptText(60) }}</h2>\r\n                <div class=\"title_info\">\r\n                    发稿时间：{{ item.lastModified | formatDate }}&nbsp;&nbsp;\r\n                </div>\r\n                <div class=\"article-detail\" v-html=\"item.context\"></div>\r\n            </div>\r\n        </div>\r\n    </div>\r\n    <!--content end-->\r\n</div>\r\n    \r\n<script>\r\n    \r\n    var {{{vm-id}}} = new Vue({\r\n        el: \'#{{{app-id}}}\',\r\n        data:function() {\r\n            return {\r\n                data: {\r\n                    category:{\r\n                        \"id\":\'\',\r\n                        \"name\":\'\'\r\n                    },\r\n                    articles:{\r\n                        \"contnet\":[],\r\n                        \"totalPages\": 0,\r\n                        \"number\": 0,\r\n                    }\r\n                },\r\n                richEditorDomain:richEditorDomain,\r\n				contextPath:contextPath\r\n            }\r\n        },\r\n        methods:{\r\n        	initData:function(data){\r\n        		{{{vm-id}}}.data = data;\r\n        	},\r\n        	jumpPage:function(page){\r\n        	    location.search=\"?pageNum=\"+page\r\n        	}\r\n        },\r\n        computed:{\r\n            show:function(){\r\n                return this.data.articles.totalPages && this.data.articles.totalPages !=1\r\n            },\r\n            pstart: function() {\r\n                return this.data.articles.number+1 == 1;\r\n            },\r\n            pend: function() {\r\n                return this.data.articles.number+1 == this.data.articles.totalPages;\r\n            },\r\n            efont: function() {\r\n                if (this.data.articles.totalPages <= 7) return false;\r\n                return this.data.articles.number+1 > 5\r\n            },\r\n            ebehind: function() {\r\n                if (this.data.articles.totalPages <= 7) return false;\r\n                var nowAy = this.data.articles.totalPages;\r\n                return nowAy[nowAy.length - 1] != this.data.articles.totalPages;\r\n            }\r\n        },\r\n        mounted: function () {\r\n        	siteAjax(this,\'{{{url}}}\')\r\n        },\r\n        filters: {\r\n            formatDate: function (date) {\r\n                 if (!date) return \'\'\r\n                var newsDate = date.split(\'T\')[0];\r\n            \r\n                return newsDate\r\n            },\r\n            interceptText:function(text,num){\r\n                if (!text) return \'\'\r\n                if (text.length <=num ) return text\r\n                var str = text.slice(0,num)+\'...\'\r\n                return str;\r\n            }\r\n        }\r\n    })\r\n</script>', '/cmsapi/b_a/', '暂无', 'module-14', 'module-14', ',MODULE-14,MODULE-14,', '', '杜雨森');
INSERT INTO `cms_templatemodule` VALUES ('15', '3', '2019-03-19 11:36:19', '2019-05-13 13:52:24', '<div id=\"{{{app-id}}}\" class=\"module-15 clearfix\">\r\n    <!--content begin-->\r\n	<div class=\"contentArt clearfix\">\r\n        <div class=\"breadcrumb\">\r\n            <ul class=\"clearfix\">\r\n                <li class=\"fl\">当前位置：<a :href=\"contextPath+\'/\'\">首页</a></li>\r\n                <li class=\"fl\">&nbsp;&gt;&nbsp;文章详情</li>\r\n            </ul>\r\n        </div>\r\n\r\n        <div class=\"articlePage\">\r\n            <h2>{{ data.article.name }}</h2>\r\n            <div class=\"title_info\">\r\n                来源：*** &nbsp;&nbsp;发稿时间：{{ data.article.lastModified | formatDate }}&nbsp;&nbsp;\r\n            </div>\r\n            <div class=\"article-detail\" v-html=\"data.article.context\"></div>\r\n        </div>\r\n    </div>\r\n    <!--content end-->\r\n</div>\r\n    \r\n<script>\r\n    \r\n    var {{{vm-id}}} = new Vue({\r\n        el: \'#{{{app-id}}}\',\r\n        data:function() {\r\n            return {\r\n                data: {\r\n                    article:{\r\n                        name:\'\'\r\n                    }\r\n                },\r\n                richEditorDomain:richEditorDomain,\r\n				contextPath:contextPath\r\n            }\r\n        },\r\n        methods:{\r\n        	initData:function(data){\r\n        		{{{vm-id}}}.data = data;\r\n        	},\r\n        },\r\n        mounted: function () {\r\n        	siteAjax(this,\'{{{url}}}\')\r\n        },\r\n        filters: {\r\n          formatDate: function (date) {\r\n            if (!date) return \'\'\r\n            var dateAll = date.split(\'T\');\r\n            var dateStr = dateAll[0]+\'  \'+dateAll[1].split(\'.000+0800\')[0]\r\n            return dateStr\r\n          }\r\n        }\r\n\r\n    })\r\n</script>', '/cmsapi/a/', '暂无', 'module-15', 'module-15', ',MODULE-15,MODULE-15,', '', '杜雨森');
INSERT INTO `cms_templatemodule` VALUES ('16', '2', '2019-03-19 11:36:33', '2019-05-09 11:26:19', '<div class=\"section-a\">\r\n<div id=\"{{{app-id}}}\" class=\"module-16 clearfix\">\r\n    <!--content begin-->\r\n    <div class=\"exp-detail\">\r\n		<h1 class=\"exp-title\">乙酰水杨酸的制备和纯化实验</h1>\r\n		<p class=\"detail-info\">\r\n			<b>所属分类：</b>化工制药类\r\n		</p>\r\n		<p class=\"detail-info\">\r\n			<span><b>实验学时：</b>5</span>\r\n			<b>实验操作步数：</b>12\r\n		</p>\r\n		\r\n		<p class=\"detail-info\">\r\n			<span><b>实验项目负责人：</b>刘伟民</span>\r\n			<b>联系电话：</b>13309286524\r\n		</p>\r\n		\r\n\r\n		<p class=\"detail-info lang-text clearfix\">\r\n			<b>实验目的：</b>通过虚拟仪器综合平台（ELVIS）和LabVIEW（图形化编程平台）的学习与开发，针对知识点进行在线原理学习、虚拟仿真、真实数据验证对比...\r\n		</p>\r\n\r\n		<p class=\"detail-info lang-text clearfix\">\r\n			<b>实验简介：</b>熟悉阿司匹林的性状、特点和化学性质，掌握酯化反应的原理和实验操作，巩固重结晶、精制、抽滤等基本操作技术，了解阿司匹林中杂质的……\r\n		</p>\r\n		\r\n		<p class=\"start-exp lang-text clearfix\">\r\n			<a href=\"\">操作实验</a>\r\n			<span>103654</span>\r\n		</p>\r\n	</div>\r\n    <!--content end-->\r\n</div>\r\n    \r\n<script>\r\n    \r\n    var {{{vm-id}}} = new Vue({\r\n        el: \'#{{{app-id}}}\',\r\n        data:function() {\r\n            return {\r\n                data: {},\r\n                richEditorDomain:richEditorDomain,\r\ncontextPath:contextPath\r\n            }\r\n        },\r\n        methods:{\r\n        initData:function(data){\r\n        {{{vm-id}}}.data = data;\r\n        },\r\n        },\r\n\r\n        mounted: function () {\r\n        siteAjax(this,\'{{{url}}}\')\r\n        }\r\n    })\r\n</script>', '/cmsapi/c_a/', '示范性网站实验信息\r\n-实验名\r\n-负责人\r\n-学时、步数\r\n-简介', 'module-16', '示范性网站实验信息', ',SFXWZSYSX,SFXWZSYXX,SHIFANXINGWANGZHANSHIYANSHENXI,SHIFANXINGWANGZHANSHIYANXINXI,', '', '杜雨森');
INSERT INTO `cms_templatemodule` VALUES ('17', '3', '2019-03-19 11:37:12', '2019-08-16 17:04:08', '<div id=\"{{{app-id}}}\" class=\"module-17 clearfix\" v-cloak>\r\n        <!--content begin-->\r\n\r\n        <!--content end-->\r\n    </div>\r\n    \r\n<script>\r\n    \r\n    var {{{vm-id}}} = new Vue({\r\n        el: \'#{{{app-id}}}\',\r\n        data:function() {\r\n            return {\r\n                data: {},\r\n                richEditorDomain:richEditorDomain,\r\ncontextPath:contextPath\r\n            }\r\n        },\r\n        methods:{\r\n        initData:function(data){\r\n        {{{vm-id}}}.data = data;\r\n        },\r\n        },\r\n\r\n        mounted: function () {\r\n        siteAjax(this,\'{{{url}}}\')\r\n        }\r\n    })\r\n</script>', '/cmsapi/c_a/', '暂无', 'module-17', '备用', ',BY,BEIYONG,', '', '杜雨森');
INSERT INTO `cms_templatemodule` VALUES ('18', '2', '2019-03-19 11:37:25', '2020-07-15 10:40:13', '<div id=\"{{{app-id}}}\" class=\"module-18 clearfix\">\r\n        <!--content begin-->\r\n\r\n        <!--content end-->\r\n    </div>\r\n    \r\n<script>\r\n    \r\n    var {{{vm-id}}} = new Vue({\r\n        el: \'#{{{app-id}}}\',\r\n        data:function() {\r\n            return {\r\n                data: {},\r\n                richEditorDomain:richEditorDomain,\r\ncontextPath:contextPath\r\n            }\r\n        },\r\n        methods:{\r\n        initData:function(data){\r\n        {{{vm-id}}}.data = data;\r\n        },\r\n        },\r\n\r\n        mounted: function () {\r\n        siteAjax(this,\'{{{url}}}\')\r\n        }\r\n    })\r\n</script>', '/cmsapi/c_c_a/', '暂无', 'module-18', '子栏目', ',ZLM,ZILANMU,', '', '杜雨森');
INSERT INTO `cms_templatemodule` VALUES ('19', '3', '2019-03-19 11:37:37', '2019-08-28 16:08:34', '<div id=\"{{{app-id}}}\" class=\"statics clearfix\" style=\"display:none;\">\r\n    <!--content begin-->\r\n    <div id=\"usageWeek\" style=\"width:1000px;height:400px;\"></div>\r\n    <div class=\"num-tips\">\r\n        <p>总使用量：<b>{{ data.pv }}</b></p>\r\n        <p>总访问量：<b>{{ data.usage }}</b></p>\r\n    </div>\r\n    <!--content end-->\r\n</div>\r\n    \r\n<script>\r\n    \r\n    var {{{vm-id}}} = new Vue({\r\n        el: \'#{{{app-id}}}\',\r\n        data:function() {\r\n            return {\r\n                data: {},\r\n                richEditorDomain:richEditorDomain,\r\n                contextPath:contextPath\r\n            }\r\n        },\r\n        methods:{\r\n            initData:function(data){\r\n                {{{vm-id}}}.data = data;\r\n                this.initEcharts(data);\r\n            },\r\n            initEcharts:function(data){\r\n                var usageWeek = echarts.init(document.getElementById(\'usageWeek\')); \r\n    			usageWeek.showLoading();\r\n                var pv = data.calendarCount.pv;\r\n                var usage = data.calendarCount.usage;\r\n                var xWeeks = [];\r\n                var weeksBrowsing = [];\r\n    	        var weeksUsage = [];\r\n    	        \r\n                for(var key in pv){\r\n                    xWeeks.push(key);\r\n                    weeksBrowsing.push(pv[key])\r\n                    weeksUsage.push(usage[key]?usage[key]:0)\r\n                }\r\n                \r\n    	        var usageOption = {\r\n    			    tooltip: {\r\n    			        trigger: \'axis\',\r\n    			        axisPointer: {\r\n    			            type: \'cross\',\r\n    			            crossStyle: {\r\n    			                color: \'#999\'\r\n    			            }\r\n    			        }\r\n    			    },\r\n    			    grid: {\r\n    			        left: \'3%\',\r\n    			        right: \'4%\',\r\n    			        bottom: \'3%\',\r\n    			        containLabel: true\r\n    			    },\r\n    			    legend: {\r\n    			        data:[\'实验项目使用量\',\'实验项目浏览量\'],\r\n    			        right:\'0\',\r\n    			        top:\'1%\',\r\n    			        show:false\r\n    			    },\r\n    			    xAxis: [\r\n    \r\n    			        {	splitLine:{show: false},//去除网格线\r\n    			            type: \'category\',\r\n    			            data: xWeeks,\r\n    			            axisPointer: {\r\n    			                type: \'shadow\'\r\n    			            }\r\n    			        }\r\n    			    ],\r\n    			    yAxis: [\r\n    			        {	splitLine:{show: false},//去除网格线\r\n    			            type: \'value\'\r\n    			        }\r\n    			    ],\r\n    			    series: [\r\n    			        {\r\n    			            name:\'实验项目使用量\',\r\n    			            type:\'line\',\r\n    			            barWidth : 15,//柱图宽度\r\n    			            data: weeksUsage,\r\n    			            itemStyle: {\r\n    							normal: {\r\n    								color: \'#1169b7\'\r\n    							}\r\n    						}\r\n    			        },\r\n    			        {\r\n    			            name:\'实验项目浏览量\',\r\n    			            type:\'line\',\r\n    			            barWidth : 15,//柱图宽度\r\n    			            data:weeksBrowsing,\r\n    			            itemStyle: {\r\n    							normal: {\r\n    								color: \'#f0c02e\'\r\n    							}\r\n    						}\r\n    			        }\r\n    			    ]\r\n    			};\r\n    			usageWeek.hideLoading();\r\n    			usageWeek.setOption(usageOption);\r\n            }\r\n        },\r\n        mounted: function () {\r\n            siteAjax(this,\'/cmsapi/pv/项目简称\')//项目简称一定要改，每个项目的简称不同，需要改成对应项目的简称 例：“http://cps.zju.owvlab.net/vlab/ywsz.html”的项目简称是ywsz 也就是ywsz.html的前缀\r\n        },\r\n    })\r\n</script>', '/cmsapi/site', '暂无', 'module-19', '统计图访问量信息', ',TJTFWLSX,TJTFWLXX,TONGJITUFANGWENLIANGSHENXI,TONGJITUFANGWENLIANGXINXI,', '', '杜雨森');
INSERT INTO `cms_templatemodule` VALUES ('20', '1', '2019-03-19 11:37:55', '2020-07-10 17:14:55', '<div id=\"{{{app-id}}}\" class=\"module-20 clearfix\">\r\n        <!--content begin-->\r\n\r\n        <!--content end-->\r\n    </div>\r\n    \r\n<script>\r\n    \r\n    var {{{vm-id}}} = new Vue({\r\n        el: \'#{{{app-id}}}\',\r\n        data:function() {\r\n            return {\r\n                data: {},\r\n                richEditorDomain:richEditorDomain,\r\ncontextPath:contextPath\r\n            }\r\n        },\r\n        methods:{\r\n        initData:function(data){\r\n        {{{vm-id}}}.data = data;\r\n        },\r\n        },\r\n\r\n        mounted: function () {\r\n        siteAjax(this,\'{{{url}}}\')\r\n        }\r\n    })\r\n</script>', '/cmsapi/c_a/', '暂无', 'module-20', '备用2', ',BY2,BEIYONG2,', '', '杜雨森');
INSERT INTO `cms_templatemodule` VALUES ('21', '9', '2019-03-19 11:39:35', '2019-03-26 09:49:16', '<div id=\"{{{app-id}}}\" class=\"module-21 clearfix\">\r\n    <!--content begin-->\r\n    <div class=\"tabSwitch\">\r\n        <ul class=\"tabs\">\r\n            <li v-for=\"item in data.articles\">\r\n                <h3 class=\"open\">{{ item.name | interceptText(10) }}</h3>\r\n                <div class=\"conMain\">\r\n                    <img :src=\"richEditorDomain+item.pic\" />\r\n                </div>\r\n            </li>\r\n        </ul>\r\n\r\n    </div>\r\n    <!--content end-->\r\n</div>\r\n\r\n<script>\r\n\r\n    var {{{vm-id}}} = new Vue({\r\n        el: \'#{{{app-id}}}\',\r\n        data:function() {\r\n            return {\r\n                data: {},\r\n                richEditorDomain:richEditorDomain,\r\n                contextPath:contextPath\r\n            }\r\n        },\r\n        methods:{\r\n            initData:function(data){\r\n                {{{vm-id}}}.data = data;\r\n            },\r\n        },\r\n\r\n        mounted: function () {\r\n            siteAjax(this,\'{{{url}}}\')\r\n        },\r\n        updated:function(){\r\n\r\n            $(\".tabs li\").eq(0).animate({width: \"848px\"}, 500);\r\n            $(\".tabs li\").hover(function () {\r\n                $(\".tabs li\").find(\"h3\").removeClass(\"open\");\r\n                $(this).stop().animate({width: \"848px\"}, 800).siblings().stop().animate({width: \"48px\"}, 800)\r\n                $(this).find(\"h3\").stop().addClass(\"open\")\r\n            });\r\n        },\r\n        filters:{\r\n            interceptText:function(text,num){\r\n                if (!date) return \'\'\r\n                var str = text.slice(0,num)+\'...\'\r\n                return str;\r\n            }\r\n        }\r\n    })\r\n</script>', '/cmsapi/c_a/', '百叶窗形式-图片切换', 'module-21', '百叶窗图片切换', ',BXCTPQH,BXCTPQH,BYCTPQH,BYCTPQH,BAIXIECHUANGTUPIANQIEHUAN,BOXIECHUANGTUPIANQIEHUAN,BAIYECHUANGTUPIANQIEHUAN,BOYECHUANGTUPIANQIEHUAN,', '', '杜雨森');
INSERT INTO `cms_templatemodule` VALUES ('22', '1', '2019-03-19 11:40:05', '2019-03-19 13:46:59', '<div id=\"{{{app-id}}}\" class=\"module-22 clearfix\">\r\n    <!--content begin-->\r\n    <div id=\"videoPlayerFrame\"></div>\r\n    <!--content end-->\r\n</div>\r\n\r\n<script>\r\n\r\n    var {{{vm-id}}} = new Vue({\r\n        el: \'#{{{app-id}}}\',\r\n        data:function() {\r\n            return {\r\n                data: {},\r\n                richEditorDomain:richEditorDomain,\r\n                contextPath:contextPath\r\n            }\r\n        },\r\n        methods:{\r\n            initData:function(data){\r\n                {{{vm-id}}}.data = data;\r\n                creatVideoArea(data)\r\n            },\r\n        },\r\n\r\n        mounted: function () {\r\n            siteAjax(this,\'{{{url}}}\')\r\n        }\r\n    })\r\n</script>', '/cmsapi/site', '门户中心视频', 'module-22', 'module-22', ',MODULE-22,MODULE-22,', '', '周兴家');
INSERT INTO `cms_templatemodule` VALUES ('23', '5', '2019-03-19 11:40:24', '2019-03-26 09:49:38', '<div id=\"{{{app-id}}}\" class=\"module-23 clearfix\">\r\n    <!--content begin-->\r\n    <div class=\"loginBox\">\r\n        <div class=\"tit\">\r\n            <span>用户登录</span>\r\n        </div>\r\n        \r\n        <form action=\"../login\" method=\"post\" class=\"login\">\r\n            <div class=\"inputBox\">\r\n                <input type=\"text\" name=\"username\" class=\"account\" placeholder=\"用户名:\">\r\n            </div>\r\n            <div class=\"inputBox\">\r\n                <input type=\"password\" name=\"password\" class=\"password\" placeholder=\"密码:\">\r\n            </div>\r\n\r\n            <div class=\"buttonBox clearfix\">\r\n                <div class=\"remember\"><input class=\"rememberInput\" type=\"checkbox\">&nbsp;记住密码</div>\r\n                <input type=\"submit\" value=\"登录\">\r\n            </div>\r\n\r\n        </form>\r\n            \r\n    </div>\r\n\r\n    <!--content end-->\r\n</div>\r\n    \r\n<script>\r\n    \r\n    var {{{vm-id}}} = new Vue({\r\n        el: \'#{{{app-id}}}\',\r\n        data:function() {\r\n            return {\r\n                data: {},\r\n                richEditorDomain:richEditorDomain,\r\ncontextPath:contextPath\r\n            }\r\n        },\r\n        methods:{\r\n        initData:function(data){\r\n        {{{vm-id}}}.data = data;\r\n        },\r\n        },\r\n\r\n        mounted: function () {\r\n        siteAjax(this,\'{{{url}}}\')\r\n        },\r\n        updated:function(){\r\n            if($.cookie(\'account\') ==null){\r\n                $(\'.rememberInput\').attr(\'checked\',false);\r\n            }else{\r\n                $(\'.rememberInput\').attr(\'checked\',\'checked\');\r\n                $(\'.account\').val($.cookie(\'account\'));\r\n                $(\'.password\').val($.cookie(\'password\'));\r\n            }\r\n            $(\'.rememberInput\').click(function(){\r\n                var name = $(\'.account\').val();\r\n                var password = $(\'.password\').val();\r\n                if($(this).is(\":checked\")){\r\n                    $.cookie(\'account\', name);\r\n                    $.cookie(\'password\', password);\r\n                }else{\r\n                    $.cookie(\'account\', null);\r\n                    $.cookie(\'password\', null);\r\n                }\r\n            });\r\n        }\r\n    })\r\n</script>', '/cmsapi/site', '用户登录入口', 'module-23', '用户登录', ',YHDL,YONGHUDENGLU,', '', '杜雨森');
INSERT INTO `cms_templatemodule` VALUES ('24', '7', '2019-03-19 11:40:54', '2019-03-26 09:49:59', '<div id=\"{{{app-id}}}\" class=\"module-24 clearfix\">\r\n    <!--content begin-->\r\n    <div class=\"operationBox\">\r\n    <div class=\"tit\">\r\n    <span>{{ data.category.name }}</span>\r\n    <label>{{ data.category.enName }}</label>\r\n    </div>\r\n    <div class=\"operation\">\r\n    <ul class=\"clearfix\">\r\n    <li v-for=\"item in data.articles\"><a :href=\"contextPath+\'/cms/a_\'+item.id+\'.html\'\" target=\"_blank\">{{ item.name | interceptText(20) }}</a></li>\r\n    </ul>\r\n    </div>\r\n</div>\r\n    <!--content end-->\r\n</div>\r\n    \r\n<script>\r\n    \r\n    var {{{vm-id}}} = new Vue({\r\n        el: \'#{{{app-id}}}\',\r\n        data:function() {\r\n            return {\r\n                data: {},\r\n                richEditorDomain:richEditorDomain,\r\ncontextPath:contextPath\r\n            }\r\n        },\r\n        methods:{\r\n        initData:function(data){\r\n        {{{vm-id}}}.data = data;\r\n        },\r\n        },\r\n\r\n        mounted: function () {\r\n        siteAjax(this,\'{{{url}}}\')\r\n        },\r\n        updated:function(){\r\n           \r\n            $(\".operationBox .operation\").each(function(){\r\n$(this).find(\"li\").each(function(i){\r\n$(this).addClass(\"img-\" + (i+1));\r\n});\r\n});\r\n        },\r\n        filters:{\r\n            interceptText:function(text,num){\r\n                if (!date) return \'\'\r\n                var str = text.slice(0,num)+\'...\'\r\n                return str;\r\n            }\r\n        }\r\n\r\n    })\r\n</script>', '/cmsapi/c_a/', '图片背景，栏目名称。', 'module-24', '图片背景文章链接', ',TPBYWZLJ,TPBJWZLJ,TUPIANBEIYINGWENZHANGLIANJIE,TUPIANBEIJINGWENZHANGLIANJIE,', '', '杜雨森');
INSERT INTO `cms_templatemodule` VALUES ('25', '3', '2019-03-19 11:41:12', '2019-03-26 09:50:20', '<div id=\"{{{app-id}}}\" class=\"module-25 clearfix\">\r\n    <!--content begin-->\r\n<div class=\"qunar\">\r\n<div class=\"e_pic_wrap\">\r\n<ul>\r\n<li v-for=\"item in data.picArticles\">\r\n<a :href=\"contextPath+\'/cms/a_\'+item.id+\'.html\'\">\r\n<img :src=\"richEditorDomain+\'/\'+item.pic\" />\r\n</a>\r\n<div class=\"e_flt_inf\">\r\n    <div  class=\"t_info\" v-show=\"false\">{{ item.intro  | interceptText(90) }}<a :href=\"contextPath+\'/cms/a_\'+item.id+\'.html\'\">[详情]</a></div>\r\n</div>\r\n<div class=\"e_bg_flt\"></div>\r\n</li>\r\n\r\n\r\n</ul>\r\n</div>\r\n\r\n<div class=\"hd\">\r\n<ul>\r\n    <li v-for=\"item in data.picArticles\"></li>\r\n</ul>\r\n</div>\r\n\r\n<div class=\"prev\"><a href=\"javascript:void(0)\"></a></div>\r\n<div class=\"next\"><a href=\"javascript:void(0)\"></a></div>\r\n</div>\r\n    <!--content end-->\r\n</div>\r\n    \r\n<script>\r\n    \r\n    var {{{vm-id}}} = new Vue({\r\n        el: \'#{{{app-id}}}\',\r\n        data:function() {\r\n            return {\r\n                data: {},\r\n                richEditorDomain:richEditorDomain,\r\ncontextPath:contextPath\r\n            }\r\n        },\r\n        methods:{\r\n        initData:function(data){\r\n        {{{vm-id}}}.data = data;\r\n        },\r\n        },\r\n\r\n        mounted: function () {\r\n        siteAjax(this,\'{{{url}}}\')\r\n        },\r\n        updated:function(){\r\n            jQuery(\".qunar\").slide({ mainCell:\".e_pic_wrap ul\",effect:\"fold\",autoPlay:true, delayTime:4000,triggerTime:5000,interTime:3500,trigger:\"click\"}); \r\n        },\r\n        filters:{\r\n            interceptText:function(text,num){\r\n                if (!date) return \'\'\r\n                var str = text.slice(0,num)+\'...\'\r\n                return str;\r\n            }\r\n        }\r\n    })\r\n</script>', '/cmsapi/c_a/', '图片轮播文字切换', 'module-25', 'module-25', ',MODULE-25,MODULE-25,', '', '杜雨森');
