INSERT INTO `cms_templatemodule` VALUES ('41', '8', '2019-03-19 11:46:02', '2019-04-02 14:06:12', '<div id=\"{{{app-id}}}\" class=\"module-41 clearfix\">\r\n    <!--content begin-->\r\n<div class=\"tit clearfix\">\r\n<span v-if  class=\"fl\">{{ data.category.name }}</span>\r\n<a  :href=\"contextPath+\'/cms/c_\'+data.category.id+\'.html\'\" class=\"fr\">+More</a>\r\n</div>\r\n<ul>\r\n<li v-for=\"item in data.articles\">\r\n<span>{{ item.lastModified | formatDate }}</span>\r\n<a :href=\"contextPath+\'/cms/a_\'+item.id+\'.html\'\">{{ item.name | interceptText(20) }}</a>\r\n</li>\r\n\r\n</ul>\r\n    <!--content end-->\r\n</div>\r\n\r\n<script>\r\n    \r\n    var {{{vm-id}}} = new Vue({\r\n        el: \'#{{{app-id}}}\',\r\n        data:function() {\r\n            return {\r\n                data: {\r\n                    category:{\r\n                        name:\'\'\r\n                    }\r\n                },\r\n                richEditorDomain:richEditorDomain,\r\ncontextPath:contextPath\r\n            }\r\n        },\r\n        methods:{\r\n        initData:function(data){\r\n        {{{vm-id}}}.data = data;\r\n        },\r\n        },\r\n        mounted: function () {\r\n        siteAjax(this,\'{{{url}}}\')\r\n        },\r\n        filters: {\r\n          formatDate: function (date) {\r\n            if (!date) return \'\'\r\n            var newsDate = new Date(date);\r\n            \r\n            var y = newsDate.getFullYear();\r\n            var m = newsDate.getMonth();\r\n            var s = newsDate.getDay();\r\n            return y+\'-\'+m+\'-\'+s\r\n          },\r\n          interceptText:function(text,num){\r\n                if (!text) return \'\'\r\n                if (text.length <=num ) return text\r\n                var str = text.slice(0,num)+\'...\'\r\n                return str;\r\n            }\r\n        }\r\n    })\r\n</script>', '/cmsapi/c_a/', '文章列表+时间', 'module-41', '普通文章列表', ',PTWZLB,PUTONGWENZHANGLIEBIAO,', '', '周兴家');
INSERT INTO `cms_templatemodule` VALUES ('42', '7', '2019-03-19 11:46:15', '2019-03-26 10:51:08', '<div id=\"{{{app-id}}}\" class=\"module-42 clearfix\">\r\n    <!--content begin-->\r\n    <div class=\"tit\">\r\n        <span>{{ data.category.name }}</span>\r\n        <a :href=\"contextPath+\'/cms/c_\'+data.category.id+\'.html\'\">更多</a>\r\n    </div>\r\n    <div class=\"li clearfix\" v-for=\"item in data.picArticles\">\r\n        <div class=\"pic-artilce fl\">\r\n            <img :src=\"richEditorDomain+\'/\'+item.pic\" style=\"width:100%;height:100%\">\r\n        </div>\r\n        <div class=\"noticNr fr\">\r\n            <a class=\"noticTit\" :href=\"contextPath+\'/cms/a_\'+item.id+\'.html\'\" target=\"_blank\">{{ item.name | interceptText(20) }}</a>\r\n            <div class=\"noticP\">{{item.intro | interceptText(20)}}</div>\r\n        </div>\r\n    </div>\r\n\r\n    <ul>\r\n        <li class=\"clearfix\" v-for=\"item in data.articles\">\r\n            <a :href=\"contextPath+\'/cms/a_\'+item.id+\'.html\'\" class=\"fl\" target=\"_blank\">·&nbsp;&nbsp;{{ item.name | interceptText(20) }}</a>\r\n            <span class=\"fr\">【{{ item.lastModified | formatDate }}】</span>\r\n        </li>\r\n    </ul>\r\n    <!--content end-->\r\n</div>\r\n    \r\n<script>\r\n    \r\n    var {{{vm-id}}} = new Vue({\r\n        el: \'#{{{app-id}}}\',\r\n        data:function() {\r\n            return {\r\n                data: {\r\n                    category:{\r\n                        name:\'\'\r\n                    }\r\n                },\r\n                richEditorDomain:richEditorDomain,\r\n                contextPath:contextPath\r\n            }\r\n        },\r\n        methods:{\r\n            initData:function(data){\r\n                {{{vm-id}}}.data = data;\r\n            },\r\n        },\r\n        \r\n        mounted: function () {\r\n            siteAjax(this,\'{{{url}}}\')\r\n        },\r\n        filters: {\r\n          formatDate: function (date) {\r\n            if (!date) return \'\'\r\n            var newsDate = new Date(date);\r\n            \r\n            var y = newsDate.getFullYear();\r\n            var m = newsDate.getMonth();\r\n            var s = newsDate.getDay();\r\n            return y+\'-\'+m+\'-\'+s\r\n          },\r\n          interceptText:function(text,num){\r\n                if (!text) return \'\'\r\n                var str = text.slice(0,num)+\'...\'\r\n                return text;\r\n            }\r\n        }\r\n    })\r\n</script>', '/cmsapi/c_a/', '单片文章简介+文章列表', 'module-42', '首篇文章图片+简介+其他列表', ',SPWZTP+JJ+QT,SPWZTP+JJ+JT,SHOUPIANWENZHANGTUPIAN+JIANJIE+QITA,SHOUPIANWENZHANGTUPIAN+JIANJIE+JITA,', '', '杜雨森');
INSERT INTO `cms_templatemodule` VALUES ('43', '5', '2019-03-19 11:46:28', '2019-03-26 10:51:27', '<div id=\"{{{app-id}}}\" class=\"module-43 clearfix\">\r\n    <!--content begin-->\r\n        <div class=\"contentPart\">\r\n            <div class=\"tit clearfix\">\r\n                <span>{{ data.category.name }}</span>\r\n                <label for=\"\">{{ data.category.enName }}</label>\r\n                <a :href=\"contextPath+\'/cms/c_\'+data.category.id+\'.html\'\" target=\"_blank\">更多</a>\r\n            </div>\r\n            <div class=\"newsContent clearfix\">\r\n                <div class=\"focusBox\">\r\n                    <ul class=\"pic\">\r\n                        <li v-for=\"item in data.picArticles\">\r\n                            <a :href=\"contextPath+\'/cms/a_\'+item.id+\'.html\'\" target=\"_blank\"><img :src=\"richEditorDomain+\'/\'+item.pic\" /></a>\r\n                        </li>\r\n                    </ul>\r\n                    <div class=\"txt-bg\"></div>\r\n                    <div class=\"txt\">\r\n                        <ul>\r\n                            <li v-for=\"item in data.picArticles\">\r\n                                <a class=\"p\" :href=\"contextPath+\'/cms/a_\'+item.id+\'.html\'\" target=\"_blank\">{{ item.name | interceptText(20) }}</a>\r\n                            </li>\r\n                        </ul>\r\n                    </div>\r\n    \r\n                </div>\r\n    \r\n                <div class=\"coursewareContent\">\r\n                    <ul>\r\n                        <li v-for=\"item in data.articles\"><a class=\"p\" :href=\"contextPath+\'/cms/a_\'+item.id+\'.html\'\">{{ item.name | interceptText(20) }}</a><span>{{ item.lastModified | formatDate }}</span></li>\r\n                    </ul>\r\n    \r\n                </div>\r\n            </div>\r\n        </div>\r\n    <!--content end-->\r\n</div>\r\n    \r\n<script>\r\n    \r\n    var {{{vm-id}}} = new Vue({\r\n        el: \'#{{{app-id}}}\',\r\n        data:function() {\r\n            return {\r\n                data: {\r\n                    category:{\r\n                        name:\'\'\r\n                    }\r\n                },\r\n                richEditorDomain:richEditorDomain,\r\n                contextPath:contextPath\r\n            }\r\n        },\r\n        methods:{\r\n            initData:function(data){\r\n                {{{vm-id}}}.data = data;\r\n            },\r\n        },\r\n        \r\n        mounted: function () {\r\n            siteAjax(this,\'{{{url}}}\')\r\n        },\r\n        updated: function(){\r\n            jQuery(\".module-43 .focusBox\").slide({\r\n                titCell:\".num li\", \r\n                mainCell:\".pic\",\r\n                effect:\"fold\", \r\n                autoPlay:true,\r\n                trigger:\"click\",\r\n                interTime:4000,\r\n                startFun:function(i){//下面startFun代码用于控制文字上下切换\r\n                    jQuery(\".module-43 .focusBox .txt li\").eq(i).animate({\"bottom\":0}).siblings().animate({\"bottom\":-36});\r\n                }\r\n            });\r\n        },\r\n        filters: {\r\n            formatDate: function (date) {\r\n                if (!date) return \'\'\r\n                var newsDate = new Date(date);\r\n                \r\n                var y = newsDate.getFullYear();\r\n                var m = newsDate.getMonth();\r\n                var s = newsDate.getDay();\r\n                return y+\'-\'+m+\'-\'+s\r\n            },\r\n            filters:{\r\n                interceptText:function(text,num){\r\n                    if (!text) return \'\'\r\n                    var str = text.slice(0,num)+\'...\'\r\n                    return str;\r\n                }\r\n            }\r\n        }\r\n    })\r\n</script>', '/cmsapi/c_a/', '轮播图片+文章列表', 'module-43', 'module-43', ',MODULE-43,MODULE-43,', '', '杜雨森');
INSERT INTO `cms_templatemodule` VALUES ('44', '5', '2019-03-19 11:46:40', '2019-03-26 10:51:43', '<div id=\"{{{app-id}}}\" class=\"module-44 clearfix\">\r\n    <div class=\"operationTit\">\r\n        <span>{{ data.category.name }}</span>\r\n    </div>\r\n    <div class=\"operationBox\">\r\n        <ul>\r\n            <li v-for=\"item in data.picArticles\">\r\n                <div class=\"pic\">\r\n                    <img :src=\"richEditorDomain+\'/\'+item.pic\" />\r\n                    <div class=\"box\">\r\n                        <a :href=\"contextPath+\'/cms/a_\'+item.id+\'.html\'\">{{ item.name | interceptText(20) }}</a>\r\n                    </div>\r\n                </div>\r\n            </li>\r\n        </ul>\r\n    </div>\r\n</div>\r\n\r\n<script>\r\n    \r\n    var {{{vm-id}}} = new Vue({\r\n        el: \'#{{{app-id}}}\',\r\n        data:function() {\r\n            return {\r\n                data: {\r\n                    category:{\r\n                        name:\'\'\r\n                    }\r\n                },\r\n                richEditorDomain:richEditorDomain,\r\n                contextPath:contextPath\r\n            }\r\n        },\r\n        methods:{\r\n            initData:function(data){\r\n                {{{vm-id}}}.data = data;\r\n            },\r\n        },\r\n        \r\n        mounted: function () {\r\n            siteAjax(this,\'{{{url}}}\')\r\n        },\r\n        updated: function(){\r\n            $(\'.module-44 .operationBox li\').hover(function(){\r\n                $(this).children(\'.pic\').find(\'.box\').stop(true,true).delay(100).animate({\'top\':0,opacity:0.8},300);\r\n                $(this).children(\'.pic\').next(\'.title\').find(\'a\').delay(100).addClass(\'bg\');\r\n            },function(){\r\n                $(this).children(\'.pic\').children(\'.box\').stop(true,true).animate({\'top\':-265,opacity:0},200);\r\n                $(this).children(\'.pic\').next(\'.title\').find(\'a\').delay(100).removeClass(\'bg\');\r\n            })\r\n        },\r\n        filters: {\r\n            formatDate: function (date) {\r\n                if (!date) return \'\'\r\n                var newsDate = new Date(date);\r\n                \r\n                var y = newsDate.getFullYear();\r\n                var m = newsDate.getMonth();\r\n                var s = newsDate.getDay();\r\n                return y+\'-\'+m+\'-\'+s\r\n            },\r\n            filters:{\r\n                interceptText:function(text,num){\r\n                    if (!text) return \'\'\r\n                    var str = text.slice(0,num)+\'...\'\r\n                    return str;\r\n                }\r\n            }\r\n\r\n        }\r\n    })\r\n</script>', '/cmsapi/c_a/', '仅图片展示', 'module-44', '图片展示列表', ',TPZSLB,TUPIANZHANSHILIEBIAO,', '', '杜雨森');
INSERT INTO `cms_templatemodule` VALUES ('45', '5', '2019-03-19 11:46:50', '2019-03-26 10:51:58', '<div id=\"{{{app-id}}}\" class=\"module-45 clearfix\">\r\n    <!--content begin-->\r\n    <div class=\"contentTitle clearfix\">\r\n        <h2>{{ data.category.name }}</h2>\r\n    </div>\r\n\r\n    <ul class=\"platList clearfix\">\r\n        <li  v-for=\"(item,index) in data.picArticles\">\r\n            <a :href=\"contextPath+\'/cms/c_\'+data.category.id+\'.html\'\">\r\n                <img class=\"leftImg\" :src=\"richEditorDomain+\'/\'+item.pic\" alt=\"\">\r\n                <div class=\"rightActle\">\r\n                    <h1>{{ item.name | interceptText(150) }}</h1>\r\n                    <p>{{ item.intro | interceptText(150) }}</p>\r\n                </div>\r\n            </a>\r\n        </li>\r\n    </ul>\r\n    <!--content end-->\r\n</div>\r\n\r\n<script>\r\n    \r\n    var {{{vm-id}}} = new Vue({\r\n        el: \'#{{{app-id}}}\',\r\n        data:function() {\r\n            return {\r\n                data: {\r\n                    category:{\r\n                        name:\'\'\r\n                    }\r\n                },\r\n                richEditorDomain:richEditorDomain,\r\n                contextPath:contextPath\r\n            }\r\n        },\r\n        methods:{\r\n            initData:function(data){\r\n                {{{vm-id}}}.data = data;\r\n            },\r\n        },\r\n        \r\n        mounted: function () {\r\n            siteAjax(this,\'{{{url}}}\')\r\n        },\r\n        updated: function(){\r\n            \r\n        },\r\n        filters: {\r\n            formatDate: function (date) {\r\n                if (!date) return \'\'\r\n                var newsDate = new Date(date);\r\n                \r\n                var y = newsDate.getFullYear();\r\n                var m = newsDate.getMonth();\r\n                var s = newsDate.getDay();\r\n                return y+\'-\'+m+\'-\'+s\r\n            },\r\n            filters:{\r\n                interceptText:function(text,num){\r\n                    if (!text) return \'\'\r\n                    var str = text.slice(0,num)+\'...\'\r\n                    return str;\r\n                }\r\n            }\r\n\r\n        }\r\n    })\r\n</script>', '/cmsapi/c_a/', '图片+该图片简介', 'module-45', '图片展示列表（文字简介）', ',TPZSLB（WZJJ）,TUPIANZHANSHILIEBIAO（WENZIJIANJIE）,', '', '杜雨森');
