INSERT INTO `cms_templatemodule` VALUES ('61', '4', '2019-03-19 11:50:11', '2019-03-26 10:52:12', '<div id=\"{{{app-id}}}\" class=\"module-61 clearfix\">\r\n    <!--content begin-->\r\n    <div class=\"titBox\">\r\n        <div class=\"tit clearfix\">\r\n            <span>{{data.category.name}}</span>\r\n        </div>\r\n    </div>\r\n    <div class=\"picScroll-left\">\r\n        <div class=\"hd\">\r\n            <a class=\"next\"></a>\r\n            <a class=\"prev\"></a>\r\n        </div>\r\n        <div class=\"bd\">\r\n            <ul class=\"picList\" >\r\n                <li v-for=\" item in data.articles\">\r\n                    <div class=\"picDate\">\r\n                        <span class=\"yy\">{{item.creation | getYearm }}</span>\r\n                        <span class=\"mm\">{{item.creation | getDay}}</span>\r\n                    </div>\r\n                    <div class=\"pic\"><a :href=\"contextPath+\'/cms/c_\'+item.id+\'.html\'\" target=\"_blank\"><img :src=\"richEditorDomain+item.pic\"/></a></div>\r\n                    <div class=\"title\">\r\n                        <span>{{item.name | interceptText(20) }}</span>\r\n                        <p>{{item.intro | interceptText(25) }}</p>\r\n                        <a :href=\"contextPath+\'/cms/c_\'+item.id+\'.html\'\">查看详情</a>\r\n                    </div>\r\n                </li>\r\n            </ul>\r\n        </div>\r\n        <div class=\"list\">\r\n            <ul>\r\n                <li v-for=\" (item,index) in data.articles\">{{index}}</li>\r\n            </ul>\r\n        </div>\r\n    </div>\r\n    <!--content end-->\r\n</div>\r\n\r\n<script>\r\n\r\nvar {{{vm-id}}} = new Vue({\r\n    el: \'#{{{app-id}}}\',\r\n    data:function() {\r\n        return {\r\n            data: {\r\n                category:{}\r\n            },\r\n            richEditorDomain:richEditorDomain,\r\n            contextPath:contextPath\r\n        }\r\n    },\r\n    methods:{\r\n        initData:function(data){\r\n            {{{vm-id}}}.data = data;\r\n        },\r\n    },\r\n    \r\n    mounted: function () {\r\n        siteAjax(this,\'{{{url}}}\')\r\n    },        \r\n    updated:function(){\r\n        jQuery(\".module-61 .picScroll-left\").slide({titCell:\".list ul\",mainCell:\".bd ul\",autoPage:true,effect:\"leftLoop\",autoPlay:true,scroll:3,vis:3,interTime:3500});\r\n    },\r\n    filters:{\r\n        getYearm:function(value){\r\n            var date = new Date(value);\r\n            var year = date.getFullYear();\r\n            var m = Number(date.getMonth())+1  < 10? \'0\'+ ( Number(date.getMonth()) +1) : Number(date.getMonth()+1);\r\n            return year+\'.\'+m;\r\n        },\r\n        getDay:function(value){\r\n            var date = new Date(value);\r\n            var day = date.getDate();\r\n            return day;\r\n        },\r\n        interceptText:function(text,num){\r\n            if (!text) return \'\'\r\n            var str = text.slice(0,num)+\'...\'\r\n            return str;\r\n        }\r\n    }\r\n})\r\n</script>', '/cmsapi/c_a/', '图片展示\r\n-- 图片滚动（图片、文章标题、文章简介）', 'module-61', '图片展示', ',TPZS,TUPIANZHANSHI,', '', '杜雨森');
INSERT INTO `cms_templatemodule` VALUES ('62', '4', '2019-03-19 11:50:22', '2019-03-26 10:52:26', '<div id=\"{{{app-id}}}\" class=\"module-62 clearfix\">\r\n    <!--content begin-->\r\n        <div class=\"demo-1slide\">\r\n            <div class=\"demo-1Hd\">\r\n                <ul>\r\n                    <li v-for=\"item in data.category.sons\">\r\n                        {{item.name}}\r\n                    </li>\r\n                </ul>\r\n                <a v-for=\"item in data.category.sons\" class=\"more\" :href=\"contextPath+\'/cms/c_\'+item.id+\'.html\'\">更多</a>\r\n            \r\n            </div>\r\n            <div class=\"demo-1Bd\">\r\n                \r\n                <div class=\"demo-1slideBox\"  v-for=\"c in data.category.sons\">\r\n                    \r\n                    <div class=\"demo-1Top\" v-for=\"item in data.picArticles[c.id]\">\r\n                        <div class=\"pic-2\"><img :src=\"richEditorDomain+item.pic\"></div>\r\n                        <div class=\"js\">\r\n                            <span>{{item.name | interceptText(20) }}</span>\r\n                            <p>{{item.intro | interceptText(40) }}</p>\r\n                            <a :href=\"contextPath+\'/cms/c_\'+item.id+\'.html\'\" class=\"xq\">详情 》</a>\r\n                        </div>\r\n                    </div>\r\n\r\n                    <div class=\"demo-1Bottom\">\r\n                        <ul>\r\n                            <li v-for=\"item in data.articles[c.id]\">\r\n                                <a :href=\"contextPath+\'/cms/c_\'+item.id+\'.html\'\">{{item.intro | interceptText(40) }}</a>\r\n                                <span>{{item.creation | formatDate}}</span>\r\n                              </li>\r\n                        </ul>\r\n                    </div>\r\n                    \r\n                </div>\r\n            </div>\r\n        </div>\r\n    <!--content end-->\r\n</div>\r\n\r\n<script>\r\n\r\nvar {{{vm-id}}} = new Vue({\r\n    el: \'#{{{app-id}}}\',\r\n    data:function() {\r\n        return {\r\n            data: {category:{}},\r\n            richEditorDomain:richEditorDomain,\r\n            contextPath:contextPath\r\n        }\r\n    },\r\n    methods:{\r\n        initData:function(data){\r\n            {{{vm-id}}}.data = data;\r\n        },\r\n    },\r\n    \r\n    mounted: function () {\r\n        siteAjax(this,\'{{{url}}}\')\r\n    },\r\n    updated:function(){\r\n       jQuery(\".module-62 .demo-1slide\").slide({titCell:\".demo-1Hd li\",mainCell:\".demo-1Bd\",trigger: \"click\"});\r\n        $(\'.module-62  .demo-1Hd  .more\').hide();\r\n        $(\'.module-62  .demo-1Hd  .more\').eq(0).show();\r\n        $(\'.module-62 .demo-1Hd ul li\').click(function(){\r\n            $(\'.module-62  .demo-1Hd  .more\').hide();\r\n            $(\'.module-62  .demo-1Hd  .more\').eq( $(this).index() ).show();\r\n        })  \r\n\r\n    },\r\n   filters: {\r\n      formatDate: function (date) {\r\n        if (!date) return \'\'\r\n        var newsDate = new Date(date);\r\n        \r\n        var y = newsDate.getFullYear();\r\n        var m = newsDate.getMonth();\r\n        var s = newsDate.getDay();\r\n        return y+\'-\'+m+\'-\'+s\r\n      },\r\n        interceptText:function(text,num){\r\n            if (!text) return \'\'\r\n            var str = text.slice(0,num)+\'...\'\r\n            return str;\r\n        }\r\n    }\r\n    \r\n })\r\n \r\n\r\n</script>', '/cmsapi/c_c_a/', '7）选项卡形式\r\n--文章列表选项卡', 'module-62', '选项卡文章列表', ',XXKWZLB,XXQWZLB,XUANXIANGKAWENZHANGLIEBIAO,XUANXIANGQIAWENZHANGLIEBIAO,', '', '杜雨森');
INSERT INTO `cms_templatemodule` VALUES ('63', '4', '2019-03-19 11:50:32', '2019-03-26 10:52:40', '<div id=\"{{{app-id}}}\" class=\"module-63 clearfix\">\r\n    <!--content begin-->\r\n    <div class=\"contentTab\">\r\n            <div class=\"module-63Tit\">\r\n                <span>{{ data.category.name }}</span>\r\n            </div>\r\n            <!-- lesson begin-->\r\n            <div class=\"lesson\">\r\n                <div class=\"demo\">\r\n                    <div class=\"demoslide\">\r\n                        <div class=\"demoHd\">\r\n                            <ul class=\"clearfix\">\r\n                                <li v-for=\"category in data.category.sons\">{{ category.name }}</li>\r\n                            </ul>\r\n                        </div>\r\n                        <div class=\"demo-Bd\">\r\n                            <div v-for=\"categoryList in data.category.sons\" class=\"demo-slideBox scroll-content\">\r\n                                <ul class=\"ware-list clearfix\">\r\n                                    <li v-for=\"item in data.picArticles[categoryList.id]\">\r\n                                        <a :href=\"contextPath+\'/cms/c_\'+item.id+\'.html\'\" target=\"_blank\" class=\"lessonImg\">\r\n                                            <img :src=\"richEditorDomain+item.pic\"/>\r\n                                        </a>\r\n                                        <div class=\"lessonContent\">\r\n                                            <a href=\"\" class=\"lessonName\">《{{item.name | interceptText(20)}}》</a>\r\n                                            <div class=\"lessonBottom clearfix\">\r\n                                                <a href=\"\">{{item.intro  | interceptText(20)}}</a>\r\n                                                <a href=\"\">{{ categoryList.name }}</a>\r\n                                                <a href=\"\">\r\n                                                    <span class=\"star\"></span>\r\n                                                    <span class=\"star\"></span>\r\n                                                    <span class=\"star\"></span>\r\n                                                    <span class=\"star\"></span>\r\n                                                    <span class=\"noStar\"></span>\r\n                                                </a>\r\n                                            </div>\r\n                                        </div>\r\n                                    </li>\r\n                                </ul>\r\n                            </div>\r\n                        </div>\r\n                    </div>\r\n\r\n                </div>\r\n            </div>\r\n            <!-- lesson end-->\r\n        </div>\r\n    <!--content end-->\r\n</div>\r\n    \r\n<script>\r\n    \r\n    var {{{vm-id}}} = new Vue({\r\n        el: \'#{{{app-id}}}\',\r\n        data:function() {\r\n            return {\r\n                data: {\r\n                    category:{\r\n                        name:\'\'\r\n                    }\r\n                },\r\n                richEditorDomain:richEditorDomain,\r\ncontextPath:contextPath\r\n            }\r\n        },\r\n        methods:{\r\n        initData:function(data){\r\n        {{{vm-id}}}.data = data;\r\n        },\r\n        },\r\n        mounted: function () {\r\n        siteAjax(this,\'{{{url}}}\')\r\n        },\r\n        updated:function(){\r\n             jQuery(\".module-63 .demoslide\").slide({titCell:\".demoHd li\",mainCell:\".demo-Bd\",trigger: \"click\"});\r\n        },\r\n        filters:{\r\n            interceptText:function(text,num){\r\n                if (!text) return \'\'\r\n                var str = text.slice(0,num)+\'...\'\r\n                return str;\r\n            }\r\n        }\r\n\r\n    })\r\n</script>', '/cmsapi/c_c_a/', '多栏目\r\n图片及图片信息展示', 'module-63', '多栏目图片展示', ',DLMTPZS,DUOLANMUTUPIANZHANSHI,', '', '杜雨森');
INSERT INTO `cms_templatemodule` VALUES ('64', '6', '2019-03-19 11:50:42', '2019-03-26 10:52:53', '<div id=\"{{{app-id}}}\" class=\"module-64 clearfix\">\r\n    <!--content begin-->\r\n            \r\n    <div class=\"slideGroup\">\r\n        \r\n        <div class=\"parHd\">\r\n            <ul>\r\n                <li v-for=\"item in data.category.sons\">{{item.name}}</li>\r\n            </ul>\r\n        </div>\r\n        \r\n        <div class=\"parBd\">\r\n            <div class=\"slideBox\" v-for=\"c in data.category.sons\">\r\n                <ul>\r\n                    <li v-for=\"item in data.articles[c.id]\">\r\n                        <div class=\"pic\"><a><img :src=\"richEditorDomain+item.pic\"/></a></div>\r\n                        <div class=\"title\"><a>{{item.name | interceptText(20) }}</a></div>\r\n                    </li>\r\n                </ul>\r\n            </div>\r\n        </div>\r\n        \r\n    </div>\r\n\r\n    <!--content end-->\r\n</div>\r\n\r\n<script>\r\n\r\nvar {{{vm-id}}} = new Vue({\r\n    el: \'#{{{app-id}}}\',\r\n    data:function() {\r\n        return {\r\n            data: {category:{}},\r\n            richEditorDomain:richEditorDomain,\r\n            contextPath:contextPath\r\n        }\r\n    },\r\n    methods:{\r\n        initData:function(data){\r\n            {{{vm-id}}}.data = data;\r\n        },\r\n    },\r\n    \r\n    mounted: function () {\r\n        siteAjax(this,\'{{{url}}}\')\r\n    },\r\n    updated:function(){\r\n        \r\n        jQuery(\".module-64 .slideGroup .slideBox\").slide({ mainCell:\"ul\",vis:5,prevCell:\".sPrev\",nextCell:\".sNext\",effect:\"leftMarquee\",interTime:30,autoPlay:true,trigger:\"click\"});\r\n        jQuery(\".module-64 .slideGroup\").slide({titCell:\".parHd li\",mainCell:\".parBd\"});\r\n    },\r\n    filters:{\r\n        interceptText:function(text,num){\r\n            if (!text) return \'\'\r\n            var str = text.slice(0,num)+\'...\'\r\n            return str;\r\n        }\r\n  