-- ----------------------------
-- Table structure for sys_last_scan_status
-- ----------------------------
DROP TABLE IF EXISTS `sys_last_scan_status`;
CREATE TABLE `sys_last_scan_status` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT,
  `version` bigint(20) NOT NULL,
  `entity` varchar(255) NOT NULL,
  `last_scanned` datetime NOT NULL,
  PRIMARY KEY (`id`) USING BTREE,
  KEY `entity` (`entity`) USING BTREE
) ENGINE=MyISAM DEFAULT CHARSET=utf8 ROW_FORMAT=DYNAMIC;

-- ----------------------------
-- Records of sys_last_scan_status
-- ----------------------------

-- ----------------------------
-- Table structure for sys_operation_logs
-- ----------------------------
DROP TABLE IF EXISTS `sys_operation_logs`;
CREATE TABLE `sys_operation_logs` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT,
  `version` bigint(20) NOT NULL,
  `cookie_id` varchar(64) DEFAULT NULL,
  `description` longtext,
  `entity_cls` varchar(255) DEFAULT NULL,
  `ip` varchar(200) DEFAULT NULL,
  `referrer_url` varchar(2038) DEFAULT NULL,
  `result` varchar(64) DEFAULT NULL,
  `session_id` varchar(64) DEFAULT NULL,
  `target` varchar(255) DEFAULT NULL,
  `target_id` varchar(255) DEFAULT NULL,
  `target_name` varchar(255) DEFAULT NULL,
  `timestamp` datetime NOT NULL,
  `type` varchar(64) NOT NULL,
  `user_account` varchar(64) DEFAULT NULL,
  `user_agent` varchar(2000) DEFAULT NULL,
  `user_name` varchar(255) DEFAULT NULL,
  PRIMARY KEY (`id`) USING BTREE
) ENGINE=MyISAM AUTO_INCREMENT=75 DEFAULT CHARSET=utf8 ROW_FORMAT=DYNAMIC;

