DROP TABLE IF EXISTS `usr_users`;
CREATE TABLE `usr_users` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT,
  `version` bigint(20) NOT NULL,
  `creation` datetime NOT NULL,
  `last_modified` datetime NOT NULL,
  `account` varchar(64) NOT NULL,
  `active` bit(1) DEFAULT NULL,
  `audited` bit(1) DEFAULT NULL,
  `cellphone` varchar(32) DEFAULT NULL,
  `cellphone_random` varchar(255) DEFAULT NULL,
  `cellphone_send_time` datetime DEFAULT NULL,
  `cellphone_verified` bit(1) DEFAULT NULL,
  `email` varchar(255) DEFAULT NULL,
  `email_random` varchar(255) DEFAULT NULL,
  `email_send_time` datetime DEFAULT NULL,
  `email_verified` bit(1) DEFAULT NULL,
  `ilabx_id` int(11) DEFAULT NULL,
  `name` varchar(64) NOT NULL,
  `name_pin_yin` varchar(255) DEFAULT NULL,
  `password` varchar(200) NOT NULL,
  `pic` varchar(2038) DEFAULT NULL,
  `private_key` varchar(1024) DEFAULT NULL,
  `public_key` varchar(1024) DEFAULT NULL,
  `qq_id` varchar(255) DEFAULT NULL,
  `random` varchar(10) DEFAULT NULL,
  `removed` bit(1) DEFAULT NULL,
  `salt` varchar(20) DEFAULT NULL,
  `send_time` datetime DEFAULT NULL,
  `sys_id` varchar(64) DEFAULT NULL,
  `telephone` varchar(32) DEFAULT NULL,
  `temporary_id` bigint(20) DEFAULT NULL,
  `tenancy_id` bigint(20) DEFAULT NULL,
  `type` int(11) DEFAULT NULL,
  `wechat_id` varchar(255) DEFAULT NULL,
  PRIMARY KEY (`id`) USING BTREE,
  UNIQUE KEY `UK_38wmrpig4nohsq7vle3c81tcv` (`account`) USING BTREE,
  UNIQUE KEY `UK_g0jloiasku8a7gat4lu7866r6` (`email`) USING BTREE,
  UNIQUE KEY `UK_c13v4hv1mv3rb0whpfv372e1g` (`wechat_id`) USING BTREE,
  KEY `lastModified` (`last_modified`) USING BTREE,
  KEY `cellphone_index` (`cellphone`) USING BTREE
) ENGINE=InnoDB AUTO_INCREMENT=3 DEFAULT CHARSET=utf8 ROW_FORMAT=COMPACT;

