-- ----------------------------
-- Table structure for visit_visitlog
-- ----------------------------
DROP TABLE IF EXISTS `visit_visitlog`;
CREATE TABLE `visit_visitlog` (
  `id` bigint(20) NOT NULL,
  `creation` datetime NOT NULL,
  `last_modified` datetime NOT NULL,
  `version` bigint(20) NOT NULL,
  `client_ip` varchar(255) NOT NULL,
  `client_region` varchar(255) DEFAULT NULL,
  `headers` varchar(2038) NOT NULL,
  `name` varchar(255) NOT NULL,
  `user_account` varchar(255) DEFAULT NULL,
  `user_name` varchar(255) DEFAULT NULL,
  `visit_uri` varchar(2038) NOT NULL,
  PRIMARY KEY (`id`) USING BTREE,
  KEY `lastModified` (`last_modified`) USING BTREE,
  KEY `clientRegion` (`client_region`,`id`) USING BTREE,
  KEY `name` (`name`) USING BTREE,
  KEY `creation` (`creation`) USING BTREE,
  KEY `clientRegionSingle` (`client_region`) USING BTREE,
  KEY `clientIp` (`client_ip`) USING BTREE,
  KEY `userName` (`user_name`) USING BTREE,
  KEY `userAccount` (`user_account`) USING BTREE
) ENGINE=MyISAM DEFAULT CHARSET=utf8 ROW_FORMAT=DYNAMIC;

